import React from 'react'
import styled from 'styled-components'
import { Link } from 'react-router-dom'
import img from '../Assets/not-found.svg'

const Error = () => {
  // const { isSideBarOpen, openSideBar } = useProductsContext()
  return (
    <Wrapper>
      <img src={img} alt='' />
      <h2 className='general'>
        Sorry! it's not allowed to go beyond this point!
      </h2>
      <Link to='/login'>
        <h2 className='error'>Please, go back this way.</h2>
      </Link>
    </Wrapper>
  )
}

const Wrapper = styled.div`
  display: grid;
  justify-content: center;
  align-items: center;
  flex-wrap: wrap;
  max-height: 80vh;
  img {
    margin-top: 2rem;
  }
  .general {
    margin: 5rem auto auto;
  }
  .error {
    margin-left: 19rem;
  }
`

export default Error
